import React from 'react';
import './Main.css';
import Product from '../components/Product';
import image from '../images/el1.png'

function Main() {

  const products = [
    {id: 1, header: 'Товар 1', image: image, price: 19000},
    {header: 'Товар 2', image: image, price: 11500},
    {header: 'Товар 3', image: image, price: 25000},
    {header: 'Товар 4', image: image, price: 21900},
    {header: 'Товар 5', image: image, price: 16999},
    {header: 'Товар 6', image: image, price: 8199}
  ]
function getProductList(){
  return products.map((item) => <Product header={item.header} image={item.image} price={item.price} />)
}
  return (
    <div className="Main">
        {getProductList()}
    </div>
  );
}

export default Main;
